<template>
  <div class="python">
    <h3>访问链接 - Windows</h3>
    <el-alert style="margin-bottom: 15px" @click.native="goLink" class="alert" :title="link" :closable="false"
              type="success"/>
    <el-button size="mini" @click="down" v-text="'下载'" type="success"/>
    <div class="card">
      <span>使用说明</span>
      <span>1、git clone 项目，或者下载压缩包</span>
      <span>2、将pyenv-win/bin以及pyenv-win/shims设入环境变量</span>
      <span>3、pyenv install -l | findstr 3.8 列出可用版本</span>
      <span>4、pyenv install 3.8.6 下载版本，需要挂梯子</span>
      <span>5、pyenv global 3.8.6 设置全局python版本</span>
    </div>

    <el-image style="width: 580px;height: 260px;margin-top: 20px" src="data:image/png;base64," />
  </div>
</template>

<script>
import {ipcRenderer} from "electron";

export default {
  name: "python",
  data: () => ({
    link: 'https://github.com/pyenv-win/pyenv-win#readme'
  }),
  mounted() {
    ipcRenderer.on("download progress", (event, progress) => {
      console.log(progress.percent); // Progress in fraction, between 0 and 1
      this.$store.state.system.percentage = Math.floor(progress.percent * 100)
      if (progress.percent === 1) {
        setTimeout(() => {
          this.$store.state.system.percentage = 0
        }, 1000)
      }
    });
  },
  methods: {
    goLink() {
      require('electron').shell.openPath(this.link)
    },
    down() {
      ipcRenderer.send('download', {
        downloadPath: 'https://github.com/pyenv-win/pyenv-win/archive/refs/heads/master.zip', // 下载链接（以下载vue文件为例）
        properties: {
          onProgress: ''
        },
        fileName: 'master.zip' // 下载文件名，需要包含后缀名
      })
    }
  }
}
</script>

